import React from 'react';
import './Main.css';

export default (props) =>{

    return(
        <div className="container">
            <div className="col-10 offset-1 mt-5 text-center Kevin">
                <h1 id="main">Hey, I'm Kevin</h1>
                <p>
                    I am a Full-Stack web developer with experience working in Python/Django, MERN, and C#/Asp.net
                </p>
                My Story:
                <p>
                    After leaving home to join the airforce, I began my life journey in Alaska working in transportation. I spent the next 
                    4 years there with 1 deployment to Qatar in the middle. When my time up in the military, I decided to continue my 
                    transportation/operations career in Seattle, WA. At the same time, I finished my BA
                </p>
            </div>
        </div>
    )
};
